xchg bx,bx   
CPU 8086
org 10000h
BITS 16
    mov ax, cs
    mov ds, ax
    mov es, ax
    mov ax, 0x00
    mov ss, ax
    mov sp, 0x7c00


mov si,pattern_data
Calculate_Off:

    mov ax,0004h
    int 10h
  
    mov ax,320
    sub ax, picture_width
    mov bx, 2
    div bx         ;ax 商 ，dx 余数  注意 余数 不要
    mov word [width_off],AX
    xor dx,dx
    mov ax,200
    sub ax, picture_length
    div bx
    mov dx,ax
    mov byte [legth_off],al
    
    
Length_Loop:
    xchg bx,bx
    mov ax, picture_length
    add ax, [legth_off]
    cmp dx,ax
    jz Draw_Over
    
    mov ax, picture_width
    mov word [remain_width],ax
    mov cx, word [width_off]
    Width_Loop:
        cmp word [remain_width], 0              ; 判断换行
        jz Next_Line 
        dec word [remain_width]          

        mov ah, 0ch
        mov al, byte [si]
        mov bh,00h
        int 10h

        inc si
        inc cx
        jmp Width_Loop

Next_Line:
    inc dx
    jmp Length_Loop

Draw_Over:

    jmp $


picture_width equ 297    ;图片宽度
picture_length equ 81   ;图片长度
width_off dw 0
legth_off db 0

remain_width dw 0

